import React from 'react';

const Work5 = () => {
    return (
        <div id='work5' className='tc dib br1 pa3 ma2 bw2 shadow-5 w-75'>
            <p>January '14 - December '14 || 1 year</p>
            <hr></hr>
            <h3>Library Research Assistant</h3>
            <p>I assisted fellow Masters, PhD, and Postdoctoral researchers with Microsoft Word and Excel related issues, referencing their research as well as searching for articles relevant to their respective work.</p>
            <hr></hr>
            <p>Stellenbosch University</p>
        </div>
    );
}

export default Work5;
